{=(topic18):scores}
{=(title18):SCORE BREAKDOWN}
{=(keyword18):scores,scoring,maxscores,maxmass,breakdown,scorecard}
{=(page18):**[BASE SCORE]**
<:YYdom:1186957907342938132> **__MAX MASS + 10 LIVES + DOMINATOR__**
- `4,100,000kg +100%` **8,200,000**
```Traditional max mass is 4,000,000 kg/4,000 tons, but you can use up to 10 additional paid lives which each include another 10,000 kg/10 tons. This will accumulate on top of each other as long as you don't eat any additional mass in between lives which allows for a new max mass of 4,100,000 kg/4,100 tons. Acquiring the "Dominator Achievement" from the achievements page gives you a permanent 100% bonus on all forthcoming scores to form the max new base score of 8,200,000.```

**[BONUSES]**
<:YYlbsmedal:1257226267728678922> **__MEDALS (10)__**
- `5% +50%` **+4,100,000**
```Medals are given based on your leaderboard rank at the time of your death. You are assigned one medal for each position on the in-game leaderboard, up to a maximum of 10 once you reach 1st place.```
<:AMlbscrown2:1015657613993709698> **__CROWNS (100)__**
- `3% +300%` **+24,600,000**
```Crowns are acquired from other snakes that have died. You also automatically receive 1 crown for each position you reach in the in-game leaderboard, up to a maximum of 10 once you reach 1st place. You can collect a maximum of 100 crowns.```
<:YYredskull:1187146745520599152> **__RED KILLS (100)__**
- `8% +800%` **+65,600,000**
```Red kills are any snake that is 10k+ in size. The red kill count maxes out at 100.```
<:YYblueskull:1187146791938969681> **__BLUE KILLS (200)__**
- `2% +400%` **+32,800,000**
```Blue kills are any snake that is under 10k. The blue kill count maxes out at 200.```
<:YYjuja1:1187149288665534545> **__JUJAS (100)__**
- `1% +100%` **+8,200,000**
```Jujas are like ladybugs that can fly and crawl. Eat up to 100 for the max bonus.```
<:YYbubble1:1187150168844414986> **__BUBBLES (300)__**
- `0.3% +90%` **+7,380,000**
```Bubbles are the green or brown bouncing coconuts. You can't eat them but you can pop up to 300 of them to count as a "bubble kill" and you can eat their contents.```
<:YYslug1:1187149487219679323> **__SLUGS (9,999)__**
- `0.03% +300%` **+24,600,000**
```Slugs come for the mass of dead snakes. They will try to eat as much of the mass as they can. Eat up to 9,999 of them for the bonus.```
<:YYlair:1187244252556705842> **__LAIR/JUJA'S GAME__**
- `0.025% +50%` **+4,100,000**
```At the end of a game you can return to the lair exit if you haven't even been killed which will immediately fulfill this bonus. Or you can fly "Juja's Game" if you die. If you successfully fill the jar with juja nectar you will fulfill this bonus. You can only choose 1 method.```
<:YYlbstrophy:1257273762022162444> **__BONUS TOTAL__**
- `+2190%` **+171,380,000**
```This is the total maximum percentage and amount of all bonuses, not including Dominator because that is incorporated into your base score.```

**[FINAL TOTAL]**
<:AM2vip:1051299947867295804> **__MAX SCORE__**
- **179,580,000**
```The final max result if all possible score opportunities have been fulfilled.```}

{=(topic19):recording}
{=(title19):SCREEN RECORDING}
{=(keyword19):screenrecordings,clips,video,ss,screenshots,recorders,software,steelseries,obs,xboxgamebar,replay,gifs}
{=(page19):```Players may falsely believe they can't record due to hardware constraints, but many systems can handle recording if you find the right tools and settings. This guide includes options for most operating systems. If one doesn't work for you it doesn't mean you can't record, keep looking for a compatible method. Verify system compatibility and review guides before installing any software/extension.```

**__DVR RECORDING__**
> The `replay` feature saves a significant amount of storage space. It uses DVR in the background while you play allowing you to record short, specific moments after they take place. 

**__UPLOAD LIMITS__**
> Discord has file size upload limits. Trim files and utilize gif conversion and compression tools.
> - Non-Nitro Members: `8mb`
> - Nitro Members: `100mb`
> - Nitro Tier 2 Servers: `50mb`
> - Nitro Tier 3 Servers: `100mb`

**__CLOUD STORAGE__**
> Google Drive is Google's cloud storage service. All Gmail users recieve 15gb of free storage which you can designate your clips to save in. Pause syncing during gameplay to avoid lag.
> - [Desktop](<https://www.google.com/drive/>) ¬∑ [Android](<https://play.google.com/store/apps/details?id=com.google.android.apps.docs>) ¬∑ [Apple](<https://apps.apple.com/us/app/google-drive/id507874739>)

**__UNIVERSAL‚èêGIF CONVERSION__**
