.comment-subjecticon img{border-radius:100%;padding:5px}

.poster-ip{font-size:85%;font-style:italic;color:#888}
.poster-ip,.poster-ip span{max-width:50%;word-wrap:break-word}

.comment-content{margin-top:1em}
.comment-content a{color:#ab1414}
/*ensure comment stretches horizontally so it's readable*/
.comment-content:before{content:"";display:block;overflow:hidden;min-width:0}

.comment-content ul,.comment-content ol{margin:1em 1em 1em 3em}

.partial{display:block;clear:both;padding:0 1em;border-radius:.5%;border:1px solid #ccc}

@media (max-width:570px){
/*untested below 278px*/
.partial{margin:0 0 2em 0;padding:0 .5em}
}

.partial .inner:last-child{padding:0 0 .5em 0}

/*hides the silly dashes*/
.partial .inner{color:#fff}
.partial a[onclick]{float:right;font-size:95%;margin:0 0 0 -.6em}

.partial .datetime{float:none;font-size:80%}
.partial .comment{border-top:0}
.partial .comment-title{padding:.3em 0 0 0;line-height:1;border:0}
.partial span{margin-top:-1em;color:#555;line-height:1.3}
.partial .comment-poster,.partial span.anonymous{margin-top:1em;margin-bottom:-.5em}
.partial .comment-poster span.anonymous{background-position:-2px -3px}
.partial span.anonymous{margin-left:-.3em}

.edittime{clear:both;position:relative;
/*8-7-21 note 2 self: find something better than display:table-->*/
display:table;margin-top:1em;font-size:80%;box-sizing:border-box;text-align:right!important;color:#888;text-transform:lowercase;font-weight:normal}
.edittime .datetime:before{content:" on ";padding:0 0 0 .2em}
.edittime .datetime{text-transform:none;font-size:100%}
.comment .footer{margin:1em 0 1em 0;padding:1em 0 0 0;clear:both}

.comment-interaction-links,.comment-management-links{text-align:right;font-size:85%;position:relative;bottom:.4em}
.comment-interaction-links a,.comment-management-links a,.module-navlinks ul li .main:first-of-type:hover{color:#444!important}
.comment-interaction-links li,.comment-management-links li{float:right;margin:0 0 0 .3em;padding:0;list-style-type:none;border-right:0;text-transform:lowercase}
.comment .text-links{margin-top:0!important}

.screened{clear:both!important;padding:1em 1em .5em 1em;border:1px solid #bbb;background:#efefef;opacity:.95;}
.screened .comment{border:0}
.screened .comment .footer{padding-bottom:2.5em} 
.screened .comment .footer .text-links{clear:both!important;display:inline} 

@media (max-width:350px){
.screened .comment .footer{padding-bottom:4.5em} 
}

.comment-posted{font-weight:bold}

/*Quick Reply form*/
#qrformdiv{clear:both;position:relative;top:-1em;padding-left:6.5em;width:100%}

.screened #qrformdiv{position:relative;top:0;left:0;min-width:0!important;border:1px solid#bbb;background:#fff!important}
.screened #qrform {position:relative;left:-1em;top:-1em}

.qr-meta span.ljuser{position:relative;top:2.2em;left:-4.6em}

/*4-10-21: DW has changed name from .qr-icon to:*/.block-icon{position:relative;top:1.75em;left:-3.8em;border:1px solid #ccc}

#submitmoreopts{position:absolute;background:#eee}
#submitmoreopts:not(*:root){position:relative;top:2.05em;left:-4.5em}

#prop_picture_keyword.select{position:relative;left:1.8em;top:-.08em;max-width:90px!important}

#qrform textarea,#postform textarea,#postform input#subject.text{padding-left:.3em;font-style:normal;background:none}

#qrform .qr-footer,#postform .qr-footer{display:block;margin-top:-.05em!important;margin-left:-.3em}
#qrform .qr-footer:not(*:root),#postform .qr-footer:not(*:root){margin-top:-.5em}
#qrform #submitpview,#postform #submitpview{margin-left:-.1em}
#submitmoreopts,#comment-text-quote,#submitpost,#submitpview{padding:.3em;background:#eee}

#qrform input,#qrform select,#postform input,#postform select{color:#666}

#qrform .de,#postform .de{display:block;clear:both!important;margin:.3em 0 0 .4em;line-height:1.5em}

@media all and (-webkit-min-device-pixel-ratio:0) and (min-resolution: .001dpcm)
{selector:not(*:root), #prop_picture_keyword.select{left:2.1em}
}

/*Longform*/
#postform{clear:both;position:static;margin-top:3em;line-height:1.7}

#postform #talkform-from{display:block;clear:both;margin:0 0 -1.5em -4.2em;font-size:92%}
#postform #talkform-from img[alt]{display:none}

#postform #username{min-width:294px;padding:.2em;font-size:.95em}
#postform #username.text,#postform #password.text,#postform #oidurl.text{font-size:.9em;font-weight:bold;color:#666!important}
#postform #password{min-width:294px;padding:.3em}

#postform #from-user-more{margin-left:3.1em}
#postform #from-user-more input{padding-left:.2em!important;background:none!important/* removes input box default usericon */}
#postform #logincheck.checkbox{position:relative;left:-.3em;top:.1em}
#postform .checkboxlabel{position:relative;left:-.4em;top:.1em}
#postform .from-login .checkbox#oidlogincheck{position:relative;left:-.3em;top:.1em}
#postform #from-openid-more{margin-left:3.2em}
#postform #from-openid-more .text{padding:.2em;max-width:55%}

#postform .block-icon,#postform .block-icon:not(*:root){top:1.8em}
/* 8-5-21: not(*:root) is working/overriding regular CSS in Fx 90.0.2 (Chromium-only hack until this?)*/
#postform .block-icon img[alt]{font-size:.7em}
/*4-10-21: longform block-icon is the size of a spec of dust unless one does this:*/
#postform .block-icon.default img{width:100%;height:100%}
#postform #prop_picture_keyword{left:-3.75em;min-width:19%!important}

#qrform .qr-markup-type .select,#postform .qr-markup-type .select{font-size:.95em}
#qrform .qr-markup-type img,#postform .qr-markup-type img{font-size:.7em;font-style:italic;background:#eee;padding:.15em}

/* comment form emoji - in this version grid stays hidden until comment-subjecticon is selected */
#postform #subjectIconImage{position:relative;top:-.2em;left:.15em;font-size:.7em;line-height:1.2}

.subjecticon-grid{border:0;display:block;margin:0 0 0 -2em;min-width:100%;font-size:.7em;line-height:1.2}
.subjecticon-grid div{margin:.3em 0 0 1.6em}
.subjecticon-grid div img{height:16px;width:16px}

.logged-in #postform #talkform-misc .checkbox,.logged-in #postform #unscreen_parent + .checkboxlabel{position:relative;top:-1.8em;font-size:95%}
.logged-in #postform #talkform-misc .checkbox{top:-1.7em;left:-.2em}
.logged-in #postform #talkform-misc label[for="editreason"]{display:block; margin-top:-1.7em}
.logged-in #postform #editreason{padding:.3em}

@media all and (-webkit-min-device-pixel-ratio:0) and (min-resolution: .001dpcm)
{selector:not(*:root), .logged-in #postform #talkform-misc #editreason{margin:-2.5em 0 .8em 0;padding:.3em}
}

#postform .qr-footer{margin-bottom:1em!important}

/*IE11 qrforms*/
@media screen and (-ms-high-contrast: active), (-ms-high-contrast: none)
{
#qrformdiv .block-icon{position:relative;top:3.6em}
#qrformdiv .qr-meta .ljuser{position:relative;top:4.3em;left:0}
#qrformdiv select#prop_picture_keyword{left:0}
#qrformdiv #submitmoreopts{top:6.4em;left:2em}
#qrformdiv #submitmoreopts{position:relative;top:6.35em;left:2.3em}
}

/*Longform logged-out*/
.logged-out #postform #subject,.logged-out #postform textarea,.logged-out #postform .qr-markup-type .select{margin:.11em 0 .3em -1em}
.logged-out #postform .qr-footer{margin:0 0 0 -1.3em}

/* Logged-out longform 'Don't have account/create one now'  */
.logged-out #postform span[style="font-size: 8pt; font-style: italic;"]{white-space:pre-wrap;word-wrap:break-word;display:inline-block;margin:0 0 0 4.3em}
.logged-out #postform span[style="font-size: 8pt; font-style: italic;"] a{background:#eee;padding:.15em}
.logged-out #postform span[style="font-size: 8pt; font-style: italic;"] a:hover{color:#444!important;background:#fff}

/* Logged-out longform no JS "HTML doesn't work in the subject."  */
.logged-out #postform .ljdeem.no-js{margin:1.2em 0 -1.3em -8.7em}

#postform #talkform-from img[alt]{display:none}
#postform .qr-markup-type img{font-size:.7em;font-style:italic;background:#eee;padding:.15em}

.logged-out #postform .qr-meta{margin-top:1.7em}
.logged-out #postform .qr-icon.no-label{position:relative;z-index:1;background:#eee;border:1px solid #ddd;top:3.59em;padding:.2em}

/*The Icon Selector  - a DW system dialog box delivered via JS - wheeeee*/
#js-icon-browser:before{content:"Icon browser";display:block;margin:0 .5em 0 0;font-size:1.7em; color:#333;font-weight:bold}
#js-icon-browser-search{margin-left:-3.3em}
input#js-icon-browser-search{padding:.3em;font-size:.95em;color:#999}
.icon-browser-meta-toggle{padding-right:.9em}
.icon-browser-meta-toggle:after{content:"~"}
#js-icon-browser-meta-toggle,#js-icon-browser-size-toggle{display:inline-block;margin-left:-.8em}
#js-icon-browser-meta-toggle a,#js-icon-browser-size-toggle a{border:0;color:#999!important}
#js-icon-browser-meta-toggle .inactive-toggle,#js-icon-browser-size-toggle .inactive-toggle
{border:1px solid#bbb;background:#eee;color:#ab1414;font-weight:bold}
.icon-browser-flex-wrapper .keyword.radius{border:0;font-weight:bold;margin:0;padding:0}

/*Archive Year(s)*/
.page-archive .navigation{margin:1em 0 0 0;border-top:1px solid #ccc;border-bottom:1px solid #ccc;text-align:left;font-weight:bold;font-style:italic;width:90%}
.page-archive .topnav ul{display:block}
.page-archive .navigation ul{padding:.6em 1em .6em 0}
.page-archive .navigation ul li{display:inline;padding:0 1em 0 0}
.page-archive .navigation a{font-weight:normal;font-style:normal;color:#888}

.page-archive .topnav ul,.page-month .topnav ul{margin:.5em 0;border-top:0}

@media (max-width:1100px){
.page-archive .navigation{width:108%;min-width:250px}
}

@media (max-width:790px){
.page-archive .navigation{width:113%;min-width:250px}
}

@media (max-width:500px){
.page-archive .navigation{margin:1.5em 0 0 0;width:120%}
}

#archive-year{padding:2.2em 4em 0;margin-left:-4em}

.month-wrapper{margin:1.5em 0}
.month-wrapper .header{position:relative; left:0;padding:0 0 .5em 0}

table.month{margin:0;border-collapse:collapse;text-align:center;width:90%}
table.month td,table.month th{padding:3px}
table.month td p{margin:0;padding:3px}
table.month th,table.month td{border:1px solid #ccc}
table.month th{font-weight:normal;height:3em;padding:.5em}
table.month td{height:4em;min-width:2.5em}

@media (max-width:375px){
table.month td,table.month th{min-height:2em;min-width:1.6em;padding:0 .25em}
}

.month-wrapper .day-has-entries{background:#f7f7f7}
.month-wrapper .day-has-entries a{color:#ab1414;border-top:1px solid #ccc}
.month-wrapper .day-has-entries:hover,.month-wrapper .day-has-entries:hover p a{color:#555}

.month-wrapper .footer{padding:.5em 0 .5em 0}
.month-wrapper .footer a{color:#888}

/*Archive Month(s)*/
.page-month .module-navlinks ul{padding-left:1em}
#archive-month{font-size:83%}
.page-month .month{margin:1em 2em 0 2em}

@media(max-width:1150px){
.page-month .month{margin:1em 2em 0 1.5em}
}

#archive-month .navigation{margin:4em 0 0 1em;border-bottom:1px solid #ccc}

@media(max-width:1150px){
#archive-month .navigation{margin:4em 0 0 .5em}
}

#archive-month .topnav{padding-top:.4em;border-top:1px solid #ccc}
#archive-month .topnav form{margin-top:-.3em;text-align:center}

#archive-month .navigation ul{display:block;padding:0;margin:0 auto;position:relative;top:1em;height:52px}
#archive-month .navigation li{display:inline}

#archive-back,.month-forward,.month-back,.month-back a,.month-forward a{color:#888;font-size:.75em;font-weight:600;font-style:normal!important}
#archive-month ul select[name="redir_key"],.page-month ul input{background:#f7f7f7;border:1px solid #ccc;font-style:normal!important}
#archive-month ul input{padding:.275em}
.page-month select,.month dd{padding:.2em}

.month dl, .month dt, .month dd,.page-month h3.entry-title{margin:0;padding:0}
.month dl{margin:0 -1em 0 -1em}
.month dl a{font-weight:bold}
.month dl dt,.month dd a{font-weight:normal}
.month dl .time{padding:.3em;margin-top:1em;margin-right:-1em;background:#f7f7f7;border:1px solid#ccc}
.month dd{font-size:1em}
#archive-month h3.entry-title{display:inline-block;margin-top:1.1em;margin-right:.6em;font-size:95%}
.overview-commentcount{display:inline-block;margin-left:-.2em;white-space:nowrap;font-size:100%;font-weight:bold;color:#ab1414}
.month .tag{display:block;margin:2em 0 0 0;width:102%;padding:1.2em 0;border-top:1px solid #ccc;border-bottom:1px solid #ccc}

@media (max-width:375px){
#archive-month ul select[name="redir_key"]{width:61%}
}

/*Tags Page*/
.tags-container{border-top:1px solid #ccc;padding:0}
.tags-container h2{font-size:1.4em;padding:.3em 0 .4em 0;border-bottom:1px solid #ccc}

@media (max-width:1090px){
.tags-container{margin-top:3.5em}
}

.ljtaglist.tags_multilevel{margin:.7em 0 .5em 0;padding-left:2.35em}
.ljtaglist.tags_multilevel ul{margin:0 0 .5em 0}
.tags-container .contents{margin-left:-1.35em;font-weight:500}
.tags-container .contents:not(*:root){margin-left:-1.2em;padding:1em 0 1em 0}

/*needs to be changed to "class" from "style"*/.ljtaglist.tags_multilevel span[style="detail-tagcount"]:hover{color:#ab1414;font-style:italic}

/*Icons Page*/
.icons-container{margin:-.4em 0 0 0;padding:0 2.5em 0 0}
.icons-container h2{padding:.7em 0 .3em 0;font-size:1.4em!important;border-top:1px solid #ccc;border-bottom:1px solid #ccc;width:105.5%}

@media(max-width:970px){
.page-icons .header,.page-icons .contents .inner{margin-left:0}
}

.sorting-options ul{margin:1em 0 -.3em;padding-left:0}
.sorting-options ul li{display:inline}

.page-icons .toppages,.page-icons .bottompages{margin:0 0 -2.7em 0;font-size:100%;padding:1em 0 2.7em 0}
.page-icons .bottompages{margin:0 0 -2em 0}

.page-icons .toppages p,.page-icons .bottompages p{display:inline;font-weight:bold}
.page-icons .toppages p a,.page-icons .bottompages p a{color:#555}

.icon-default .icon-image{padding-top:1em}
.default.label{margin-bottom:0}
.icon .default{border-top:1px solid #ccc;padding-top:1em}
.icon.icon-default{padding:0 0 2.2em 0}

.icon-keywords{padding:.4em 0 0 0}
.icon-keywords ul{display:inline;margin-left:0;padding-left:0}
.icon-keywords ul li{display:inline}

.icon-info span{font-weight:bold}
.icon{width:105%;min-height:78px;margin:1em 3em 0 0;padding:0 0 2.8em 0}
.icon,.icon-keywords li{border-bottom:1px solid #ccc}

.icon-image{float:right;clear:both;margin:.15em 0 0 1em}
.icon-description{margin-bottom:-1em}

/*Modules*/
.module-section-one{margin:.2em 0 0 .2em;padding-bottom:1em}
.page-tags .module-section-one,.page-month .module-section-one{margin-top:0}

.module-section-one .module-content li{margin:0;padding:.3em 0}
.module-content ul{list-style:none;margin:0;padding-left:0}
.module-content li{margin:.5em 0;padding:.3em 0;font-size:1em}
.module-content{padding-top:.8em;font-size:95%}
.module-typelist2 .module-content{font-size:100%}
.module-content,.module-section-one .module-list a{font-style:normal}

.module-header{text-transform:none!important;font-size:1.35em}
.module h2{padding-top:.4em;padding-bottom:.4em;text-transform:lowercase;border-top:1px solid #ccc;border-bottom:1px solid #ccc}

.module-userprofile h2{display:none;border-top:0}
.module-userprofile .journal-name{display:none;padding-bottom:.3em}

.module-userprofile .journal-website-name{padding-top:.5em;padding-bottom:.5em}
.module-userprofile .journal-website-name:before{content:"Website: "}

.logged-out .module-userprofile{margin-bottom:0}

ul.userlite-interaction-links{display:none;list-style:none}
ul.userlite-interaction-links li{display:block}
ul.userlite-interaction-links.icon-links{margin-left:0;padding-left:0}
ul.userlite-interaction-links.icon-links li{display:inline; padding:0 .20em}
ul.userlite-interaction-links.text-links{text-align:left}
ul.userlite-interaction-links.text-links a{padding:0}

.module-calendar .module-content{padding-top:0}
.module-calendar table{text-align:center;width:90%}
.module-calendar th,.module-calendar td{height:2em;line-height:2em;border:1px solid #ddd}
.module-calendar td a{display:block;text-align:center;background:#eee}
.module-calendar td a:hover{background:#fff}

.search-form .search-box-item, .search-form .search-button-item{display:block}
.search-form .comment_search_checkbox_item{display:inline}
.search-form{margin-left:-.3em;margin-bottom:1em}
.search-form input,.module-section-one .search-form span{padding:.4em;font-size:95%}
.search-form .search-button-item input{background:#eee}
.search-form .comment_search_label{display:inline-block;margin:0 0 0 -.8em;font-style:italic}
.search-form .comment_search_label:after{content:"?"}
.comment_search_checkbox{position:relative;left:-.25em;top:-.08em}

.module-pagesummary,.module-active,.module-typelist2{margin-bottom:1.1em}
.module-pagesummary .ljuser{white-space:normal!important}
.module-pagesummary .module-content{word-wrap:break-word}

span.pagesummary-commentcount{white-space:nowrap}
span.pagesummary-commentcount a {margin-left:-.3em;font-weight:bold;color:#ab1414}
span.pagesummary-commentcount:before{content:"[ "}
span.pagesummary-commentcount:after{content:" ]"}

.module-tags_list .detail-tagcount{white-space:nowrap}
.module-tags_list .detail-tagcount:before{content:"["}
.module-tags_list .detail-tagcount:after{content:"]"}
.module-tags_list .detail-tagcount:hover{color:#ab1414;font-style:italic}

.active-entry-label{font-weight:bold}

/*Footer*/
#footer{margin:0;padding:0;text-transform:lowercase;border-top:1px solid #ccc}
#footer .inner{padding:1em 0 3em 0}

.top,.page-top{padding:0;transform:rotate(-1.7deg)}

@media(max-width:1200px){
.top,.page-top{margin-top:.7em}
}

.top a,.page-top a{padding:15px;padding-top:9px;padding-bottom:9px;font-size:85%;background:#ab1414;border-radius:5%;color:#fff}
.top a:hover,.page-top a:hover{color:#eee!important}

#statistics{min-height:35px;background:#010101}

/* Misc. Edits */
::-moz-selection,::selection{background:#444;color:#fff}

/*DW Global Navbar aka The Navigation Strip*/
.has-navstrip .module-navlinks,.has-navstrip .module-navlinks ul{margin-left:0}

@media (max-width:750px){
.has-navstrip #header h1{margin-top:.1em}
}

/*todo:add on:focus textbox/form bg color*/
#lj_controlstrip{padding:1em 0 1em 0;background:#fff;border-bottom:1px solid #ccc}

#lj_controlstrip form{font-size:.95em}
#lj_controlstrip a:hover{text-decoration:none;color:#ab1414!important}

#lj_controlstrip_userpic{width:40px;height:40px;margin:-.3em 0 0 1.5em;padding:3px 3px 6px 3px!important;background:#f7f7f7;border:1px solid #ccc}
#lj_controlstrip_userpic img{width:40px;height:43px}
#lj_controlstrip_userpic a,#lj_controlstrip_userpic a:hover,.cutTagControls a:hover,.icon-links a:hover{border:0}

@media (max-width:1300px){
#lj_controlstrip_userpic{margin-left:.8em;margin-bottom:.3em}
}

@media (max-width:450px){
/*#lj_controlstrip{padding:1em 2%}*/
#lj_controlstrip_userpic{display:none!important}
#lj_controlstrip_actionlinks{padding-top:1em!important}
}

#lj_controlstrip_user{position:relative;top:-.4em} 
 
#lj_controlstrip #Logout{display:inline-block;font-size:1em!important;margin:0 1.15em .3em .7em;padding:.3em} 
#lj_controlstrip #Logout, #lj_controlstrip input[type='submit'],.page-month input[type='submit']{cursor:pointer}

#lj_controlstrip input{max-width:40%;padding:.23em .3em!important} 
#lj_controlstrip_login,#lj_controlstrip_actionlinks,#lj_controlstrip_user{margin-bottom:-.6em;border:0!important}

span#lj_controlstrip_statustext{position:relative;top:-.5em;color:#444;font-size:100%}
#lj_controlstrip_readfilter .select{padding:.3em}

#lj_controlstrip_search form{margin-bottom:.5em}
#lj_controlstrip_search .select{padding:.27em} 
#lj_controlstrip_search .select:not(*:root){padding:.31em} 
#lj_controlstrip .appwidget-search{position:relative;min-width:40px}

#lj_controlstrip .subscribed #lj_controlstrip_actionlinks{margin-top:-.2em!important}
 
#lj_controlstrip_login_secondary_controls,#lj_controlstrip_search{margin-top:.5em}

.logged-out #lj_controlstrip_userpic{visibility:hidden;margin-left:-4.2em}
.logged-out #lj_controlstrip_userpic:not(*:root){margin-left:-4em}
.logged-out.has-navstrip #lj_controlstrip input#xc_remember.checkbox{position:relative;top:.15em}
.logged-out.has-navstrip #lj_controlstrip td label{font-size:1.2em;padding-left:.3em}
.logged-out.has-navstrip #lj_controlstrip_actionlinks{margin-top:.9em;margin-right:2%}
.logged-out.has-navstrip #lj_controlstrip input#xc_user,.logged-out.has-navstrip #lj_controlstrip input#xc_password{min-width:150px} 

/*Userpics/usericon hover*/ 
.ui-tooltip{box-shadow:none!important}
.ui-tooltip img:hover{transition-duration: 1s;transition-property: transform;transition-timing-function: ease-in-out;transform: rotate(-270deg)}
.ui-tooltip.ui-widget{max-width:10.5em;padding:.5em 1em .5em 1em;background:#fff;border-radius:2%;border:1px solid #ccc}
.ui-tooltip.ui-widget div,.icon:last-of-type,.page-reply .screened{font-size:95%;border:0}
.ui-tooltip.ui-widget ul{margin:-1em 0 1em -.5em;padding-top:.11em}
.ui-tooltip.ui-widget li{list-style-type:none}
.ui-tooltip.ui-widget li a{font-weight:bold;font-size:85%}
.Relation{padding:1em 0 0 0;max-width:35%}
.ui-tooltip.ui-widget img{margin:.6em 0 0 1.3em!important;border:1px solid #ccc;background:#eee;padding:.3em;width:50px;height:50px}
.logged-out .ui-tooltip.ui-widget img{margin:.4em 0 -.8em 0}

/*DW Changelog Digest*/
.journal-changelog_digest .entry tbody tr{background:none!important}
.journal-changelog_digest .entry dt,.journal-changelog_digest .entry dd{border:1px solid #ddd;border-bottom:0;max-width:89%;padding:.5em}
.journal-changelog_digest .entry dt{max-width:89%;padding:.5em;font-weight:bold;color:#ab1414;text-decoration:underline}
.journal-changelog_digest .entry dt:first-of-type{margin-top:-.3em}
.journal-changelog_digest .entry dt{display:block;margin-left:1em;max-width:89%}
.journal-changelog_digest dd:before{content:"~";display:inline-block;padding:0 .1em}
.journal-changelog_digest .entry dt:hover,.journal-changelog_digest .entry dt a:hover{color:#666!important}
.journal-changelog_digest dd{font-style:italic}

/*DW Polls*/
.poll-container{display:block;margin-top:-.5em}
.poll-status{display:block;margin:1.2em 0 1em 0}
.poll-control{display:block;padding:0 0 1.5em 0}
.poll-title b:after{content:":";font-weight:normal}
.poll-title i{font-weight:bold}
.poll-title i:before,.poll-title i:after{content:"''"}
.poll-inquiry p{margin-top:-.5em;padding-bottom:.5em}
.poll-inquiry div{display:block;margin-left:0!important}
.poll-response table{margin-bottom:1.3em}
.poll-response input{margin-left:0}
.poll-response{display:inline-block;margin-top:-1em!important;margin-bottom:1em!important}
.poll-response tr td{margin-left:-.3em}
.poll-response span{max-width:65%}
.poll-response p{margin-top:0;margin-bottom:.3em}
.poll-response input[value=""]{display:block;margin-top:-1.1em;margin-bottom:1.3em;padding:.3em;width:95%;font-size:95%;color:#ab1414}
.poll-container td img,.poll-container p img{border:0;margin:0;background:none;padding:0}
.poll-container input.LJ_PollSubmit{padding:.3em 1em;background:#eee;font-size:.93em;cursor:pointer}

/*MADA (Make America Display:none Again)*/
