.bottomcomment,.bottomcomment label input,.bottomcomment input,.bottomcomment select,.multiform-checkbox,.page-day .day-date,.page-archive table caption,
.page-archive .navigation.bottomnav{position:absolute;overflow:hidden;height:1px;width:1px;margin:-1px;padding:0;font-size:0;border:0;background:0; clip:rect(0 0 0 0);clip:rect(0, 0, 0, 0)}

function visitedSum(book,page){
	var sum = 0;
	Object.keys(historybook[book]).forEach(page => {
		sum += historybook[book][page];
	});
	return sum;
}

function visitedCount(book,page){
	var count = 0;
	Object.keys(historybook[book]).forEach(page => {
		if ( historybook[book][page] > 0 ) {
			count += 1;
		}
	});
	return count;
}
